import { useState } from "react";

const Login = () => {
  const [id, setId] = useState("");
  const [password, setPassword] = useState("");

  return (
    <div className="Login">
      <div className="intro">
        <h4>AdHunter</h4>
        <div>adhunter 로그인 페이지 입니다. 오신 것을 환영합니다</div>
      </div>
      <div>
        <input
          name="id"
          value={id}
          onChange={(e) => setId(e.target.value)}
        ></input>
        <input
          name="password"
          value={password}
          onChange={(e) => setId(e.target.value)}
        ></input>
      </div>
    </div>
  );
};
export default Login;
